clc;
clear;
close all;

% Step 1: Load your image
pcb_ref = imread("C:\matlap projects\4\pcb_ref.jpg");

% Step 2: Convert to grayscale
gray = rgb2gray(pcb_ref);

% Step 3: Resize (optional)
gray = imresize(gray, [512 512]);

% Step 4: Enhance contrast & filter noise
gray_adj = imadjust(gray);                 % improve contrast
gray_filt = medfilt2(gray_adj);           % reduce salt-and-pepper noise

% Step 5: Edge Detection
edges = edge(gray_filt, 'Canny');         % detect track edges
figure, imshow(edges), title('Edge Detection - Possible Defects'); %[output:5be974cd]

% Step 6: Morphological operations to clean edges
se = strel('disk', 1);                    % structuring element
closed = imclose(edges, se);             % close gaps
cleaned = bwareaopen(closed, 50);        % remove small noise

figure, imshow(cleaned), title('Cleaned Defect Regions'); %[output:5db6d104]

% Step 7: Overlay on Original Image
% Convert grayscale or original to RGB
if size(pcb_ref,3) == 1
    pcb_ref = cat(3, pcb_ref, pcb_ref, pcb_ref);
end

overlay = pcb_ref;
overlay(:,:,1) = pcb_ref(:,:,1) + uint8(cleaned)*255;  % increase red channel %[output:32059cb3]
overlay(:,:,2) = pcb_ref(:,:,2) .* uint8(~cleaned);    % suppress green
overlay(:,:,3) = pcb_ref(:,:,3) .* uint8(~cleaned);    % suppress blue

figure, imshow(overlay), title('Defect Areas Highlighted in Red');

% Step 8: Save result (optional)
imwrite(overlay, "C:\matlap projects\4\output_defect_overlay.jpg");


